INSERT INTO drzavnamatura.super_questions (id, question, img_id, audio_id) VALUES (1, 'Agronomi su istraživali potrošnju kisika dviju sorta pšenice pri različitim temperaturama. U postavljenome pokusu zrna pšenice obiju sorta klijala su na vlažnim papirnatim ručnicima u istim uvjetima. Nakon što su biljke isklijale, mjerena je potrošnja kisika sorta A i B na temperaturama 7 °C i 17 °C u vremenskim intervalima od 20, 40, 60 i 80 minuta. Pozorno promotrite rezultate istraživanja navedene u tablici.', 255, null);
INSERT INTO drzavnamatura.super_questions (id, question, img_id, audio_id) VALUES (2, 'Agronomi su istraživali potrošnju kisika dviju sorta pšenice pri različitim temperaturama. U postavljenome pokusu zrna pšenice obiju sorta klijala su na vlažnim papirnatim ručnicima u istim uvjetima. Nakon što su biljke isklijale, mjerena je potrošnja kisika sorta A i B na temperaturama 7 °C i 17 °C u vremenskim intervalima od 20, 40, 60 i 80 minuta. Pozorno promotrite rezultate istraživanja navedene u tablici.', 256, null);
INSERT INTO drzavnamatura.super_questions (id, question, img_id, audio_id) VALUES (3, 'Bijeli je fosfor pri sobnoj temperaturi vrlo reaktivna, otrovna i samozapaljiva čvrsta tvar. Reakcijom 11,5 g fosfora s ( 11,2 dm^3 ) klora pri normalnim uvjetima (p = 101 kPa, t = 0 °C) dobiveno je 42,6 g fosforova(III) klorida. Promjena je prikazana zadanom jednadžbom kemijske reakcije. P4 + 6 Cl2 → 4 PCl3', null, null);
INSERT INTO drzavnamatura.super_questions (id, question, img_id, audio_id) VALUES (4, 'Burmanski piton vrsta je zmije specifičnoga procesa razmnožavanja. Ženke te vrste tijekom inkubacije tijelom obaviju jaja pri čemu učestalo stežu mišiće, što nazivamo drhtanje. Pozorno promotrite sliku na kojoj su prikazani rezultati istraživanja potrošnje kisika tijekom stezanja mišića ženke burmanskoga pitona u procesu inkubiranja jaja pri stalnoj temperaturi okoliša.', 257, null);
INSERT INTO drzavnamatura.super_questions (id, question, img_id, audio_id) VALUES (5, 'Crnu boju krzna psa koker španijela određuje dominantan gen B, a crvenu boju recesivni gen b. Jednobojno krzno određuje dominantan gen D, a pjegavo krzno recesivni gen d. Ti su geni smješteni na autosomima i nisu vezani.', null, null);
