INSERT INTO drzavnamatura.super_questions (id, question, img_id, audio_id) VALUES (10, 'Na slici je prikazan pokus u kojemu su se učenici koristili biljkom lončanicom. Površinu zemlje prekrili su folijom, a zatim su cijelu biljku prekrili staklenim zvonom. Rub između staklene podloge i staklenoga zvona premazali su vazelinom. Biljku su ostavili na osvijetljenome mjestu tijekom jednoga dana.', 260, null);
INSERT INTO drzavnamatura.super_questions (id, question, img_id, audio_id) VALUES (11, 'Nasljednu onihoosteodisplaziju karakteriziraju poteškoće u razvoju noktiju, kostiju i zglobova. Tu bolest uzrokuje dominantni alel (D), a zdravo stanje određuje recesivni alel (d). Geni odgovorni za bolest nalaze se na devetome kromosomu na kojemu su i geni za krvne grupe AB0 sustava.', null, null);
INSERT INTO drzavnamatura.super_questions (id, question, img_id, audio_id) VALUES (12, 'Obalna sekvoja biljna je vrsta koja je prirodni heksaploid. Pretpostavlja se da se razvila iz diploidnih predaka (2n = 22) uslijed mutacija za vrijeme mejoze.', null, null);
